import React, { Component } from 'react';
import './App.css';
import Menu from '../../Containers/Menu/Menu';
import { Route } from 'react-router-dom'
import { CocktailContainer } from '../../Components/CocktailContainer/CocktailContainer';
import PartyContainer from '../'
export class App extends Component {
  constructor() {
    super();
  }

  componentDidMount() {

  }

  render() {
    return (
      <div className='App'>
        <Menu />
        <Route
          path='/cocktails'
          render={props => (
            <CocktailContainer />
          )}>
        </Route>
        <Route
          path='/parties'
          render={props => (
            <PartyContainer />
          )}>
          </Route>
      </div>
  );
}

}

export default App;
